import React from 'react';
import Card from '../Card';
import s from './CardList.module.css';

const CardList = ({item = []}) => {
    return (
        <div>
            <div className={s.container}>
                <h2>Найпопулярніший тур цього місяця</h2>
                

                {
                    item.map(({text, img, map}, index) => <Card key={index} text={text} img={img} map={map}/>)
                }
            </div>
        </div>
    );
}

export default CardList;
